def minFallingPathSum(matrix):
    sm = 9999999;
    for i in range(len(matrix[len(matrix[0])-1])):
        sm = min([minFallingPathSumR(matrix,len(matrix)-1,i),sm])
    return sm

def minFallingPathSumR(matrix,i,j,memo={}):
    if(j<0 or j>=len(matrix[0])): return 9999999;
    if(i<0): return 999999;
    key = f"{i},{j}"
    if(key in memo): return memo[key];
    if(i==0): memo[key] = matrix[0][j]; return matrix[0][j]
    memo[key] = min([minFallingPathSumR(matrix,i-1,j-1,memo)+matrix[i][j],minFallingPathSumR(matrix,i-1,j,memo)+matrix[i][j],minFallingPathSumR(matrix,i-1,j+1,memo)+matrix[i][j]])
    return memo[key];

